webpackJsonp([0x5f0ca7f871b5],{1042:function(e,t){e.exports={data:{nodePost:{title:"CSS Tricks Rabbit Hole",link:null,body:{value:'<p>Went down a bit of a CSS-Tricks rabbit hole over lunch today.</p>\r\n\r\n<p>Started with <a href="https://css-tricks.com/complexity/">Complexity.</a> I\'ve enjoyed all of the recent point / counterpoints about the increasing complexity of front end development. This is a nice summary.</p>\r\n\r\n<p>That led me to <a href="https://css-tricks.com/future-front-end-web-development/">The Future of Front End Web Development</a>. Totally agree with everything in there, maybe with the exception of \'the line between native and web is blurring.\' I\'d probably just put that one in the future-future of front end web development category. Not quite there yet, but looking forward to when it is more of a reality.</p>\r\n\r\n<p>And then that led me to <a href="https://css-tricks.com/project-need-react/">When Does a Project Need React.</a> The more comfortable I become with how state is managed in a framework like React, the more insane our old jQuery tricks to jam state into the DOM seem.  That said, not all projects have complex state.</p>'},created:1519503565}},pathContext:{slug:"/note/css-tricks-rabbit-hole/"}}}});
